import React, { 
  Component,  
} 
from 'react';

import {
  Column,
  Grid,
  Row,
  Container
} 
from "./components/bootstrap";

import Title from "./components/bootstrap/titles";

class App extends Component {
  render() {
    return (
      <Container fluid bg-light>
        <Grid>
            <Row>
              <Column bg-dark>
                <Title text-light>abra</Title>
              </Column>
              <Column bg-gray>
                <Title text-dark>abra</Title>
              </Column>
            </Row>
          </Grid>
      </Container>
    );
  }
}

export default App;
